Jody



	----- Original Message -----=


	From: Vicki Talbott &lt;mailto:vtalbott1@...&gt;  

	To: EVP-ITC@yahoog=
roups.com 

	Sent: Monday, June 19, 2006 5:43 PM

	Subject: RE: [EVP-ITC] V=
oice about Art Bell.



	Boy Frank, do I ever agree with you about Coast =
to Coast.  Used
to listen to it but no more.  I like Jeff Rense&#39;s programmi=
ng much
better.

	Sumption Frank &lt;fsumption@...&gt; wrote: 

		 I c=
an&#39;t image anyone on the other side wanting, or
expecting us to work for Ar=
t Bell, talk about someone that&#39;s negative!
Art&#39;s whole thing is to try to =
twist everything to the dark side. It&#39;s
the same with everyone on Coast to =
Coast, they try to make it all as
scary, and fear based as possible. That v=
oice I got was probably from
the darkheads, everything else on that tape wa=
s. I finally gave up on
it, and ran another session last night. 



