		I hear that exactly as you do. That made me dig out one
of m=
ine. They were talking about art but when I was listening i heard
&quot;its oliv=
er (all over) misty come closer to art work of art&quot; and in my
mind I was th=
inking art/painting/craft aka images not art bell LOL so
had to dig it out =
to see if thats still what i hear thru the fuzz.

		The image group and the=
 regular evp group communicate in
different ways so I still think they mean=
t images, however they have
been trying to get me to move out of this neigh=
borhood but I am not
moving closer to art bell. Have a friend from there an=
d the food is a
little too strange for me LOL.

		Misty



		Sumption F=
rank &lt;fsumption@...&gt; wrote:

			Hi All;

			 I found this on the =
second listening of the
